# Find All Anagrams in a String
# https://leetcode.com/problems/find-all-anagrams-in-a-string/
# medium
#
# Time:  O(S)
# Space: O(P)

from collections import Counter

def findAnagrams(s: str, p: str) -> [int]:
    if len(s) < len(p) or not s:
        return []

    pc = Counter(p)
    sc = Counter(s[:len(p)-1])

    ans = []
    for i in range(len(p)-1, len(s)):
        sc[s[i]] += 1

        if sc == pc:
            ans.append(i - len(p) + 1)

        sc[s[i-len(p) + 1]] -= 1

        if sc[s[i-len(p) + 1]] == 0:
            del sc[s[i-len(p) + 1]]

    return ans


print(findAnagrams("cbaebabacd", "abc"), [0, 6])
print(findAnagrams("abab", "ab"), [0, 1, 2])

print(findAnagrams("",
"yqrbgjdwtcaxzsnifvhmou"))

print(findAnagrams("",
""))
